import React from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import { Entypo, FontAwesome, Feather } from '@expo/vector-icons';

import tCadastroFotoC from './pages/CadastroCuidador/tCadastroFotoC';
import tCadastroInfoC from './pages/CadastroCuidador/tCadastroInfoC';
import tCadastroLocalC from './pages/CadastroCuidador/tCadastroLocalC';

import tCadastroFotoU from './pages/CadastroUsuario/tCadastroFotoU';
import tCadastroInfoU from './pages/CadastroUsuario/tCadastroInfoU';
import tCadastroLocalU from './pages/CadastroUsuario/tCadastroLocalU';

import tEsqueciSenha from './pages/tEsqueciSenha';
import tNovaSenha from './pages/tNovaSenha';
import tSelecaoUser from './pages/tSelecaoUser/index';
import tLogin from './pages/tLogin/index';
import tDetalhes from './pages/tDetalhes';
import tFavoritos from './pages/tFavoritos/index';
import tPerfilBaba from './pages/tConfiguracao';
import tPesquisa from './pages/tPesquisa';
import tRecentes from './pages/tRecentes';

const AppStack = createStackNavigator();
const Tab = createBottomTabNavigator();

export default function Routes() {
  return (
    <NavigationContainer>
      <AppStack.Navigator headerMode="none" screenOptions={{ cardStyle: { backgroundColor: '#F0F0F5' } }}>
        <AppStack.Screen name="tLogin" component={tLogin} />
        <AppStack.Screen name="tCadastroFotoC" component={tCadastroFotoC} />
        <AppStack.Screen name="tCadastroFotoU" component={tCadastroFotoU} />
        <AppStack.Screen name="tCadastroInfoC" component={tCadastroInfoC} />
        <AppStack.Screen name="tCadastroInfoU" component={tCadastroInfoU} />
        <AppStack.Screen name="tCadastroLocalC" component={tCadastroLocalC} />
        <AppStack.Screen name="tCadastroLocalU" component={tCadastroLocalU} />
        <AppStack.Screen name="tEsqueciSenha" component={tEsqueciSenha} />
        <AppStack.Screen name="tSelecaoUser" component={tSelecaoUser} />
        <AppStack.Screen name="tNovaSenha" component={tNovaSenha} />
        <AppStack.Screen name="tDetalhes" component={tDetalhes} />
        <AppStack.Screen name="Routes2" component={Routes2} />
      </AppStack.Navigator>
    </NavigationContainer>
  );
}

function Routes2() {
  return (
    <Tab.Navigator
      screenOptions={{
        tabBarActiveTintColor: '#1E90FF',
        tabBarShowLabel: false,
        tabBarStyle: {
          position: 'absolute',
          backgroundColor: '#FFC0CB',
        },
      }}
    >
      <Tab.Screen
        name="Pesquisa"
        component={tPesquisa}
        options={{
          headerShown: false,
          tabBarIcon: ({ color, size, focused }) => {
            if (focused) {
              return <FontAwesome name="search" size={size} color={color} />;
            }
            return <Feather name="search" size={size} color={color} />;
          },
        }}
      />
      <Tab.Screen
        name="Favoritos"
        component={tFavoritos}


        options={{
          headerShown: false,
          tabBarIcon: ({ color, size, focused }) => {
            if (focused) {
              return <FontAwesome name="heart" size={size} color={color} />;
            }
            return <Feather name="heart" size={size} color={color} />;
          },
        }}
      />
      <Tab.Screen
        name="Recentes"
        component={tRecentes}
        options={{
          headerShown: false,
          tabBarIcon: ({ color, size, focused }) => {
            if (focused) {
              return <Entypo name="back-in-time" size={size} color={color} />;
            }
            return <Entypo name="back-in-time" size={size} color={color} />;
          },
        }}
      />
      <Tab.Screen
        name="PerfilBaba"
        component={tPerfilBaba}
        options={{
          headerShown: false,
          tabBarIcon: ({ color, size, focused }) => {
            if (focused) {
              return <FontAwesome name="user-circle" size={size} color={color} />;
            }
            return <FontAwesome name="user-circle-o" size={size} color={color} />;
          },
        }}
      />
    </Tab.Navigator>
  );
}
